import React from "react";
import { useNavigate } from "react-router-dom";

function DashboardPage() {
    const navigate = useNavigate();

    return (
        <div>
            {/* Navigation Bar */}
            <div
                style={{
                    display: "flex",
                    backgroundColor: "red",
                    width: "100%",
                    height: "60px",
                    alignItems: "center",
                }}
            >
                <button
                    style={{
                        flex: 1,
                        height: "100%",
                        backgroundColor: "darkred",
                        color: "white",
                        border: "none",
                        fontSize: "18px",
                        cursor: "pointer",
                    }}
                    onClick={() => navigate("/calview")}
                >
                    Calendar View
                </button>
                <button
                    style={{
                        flex: 1,
                        height: "100%",
                        backgroundColor: "darkred",
                        color: "white",
                        border: "none",
                        fontSize: "18px",
                        cursor: "pointer",
                    }}
                    onClick={() => navigate("/addevent")}
                >
                    Add Event
                </button>
                <button
                    style={{
                        flex: 1,
                        height: "100%",
                        backgroundColor: "darkred",
                        color: "white",
                        border: "none",
                        fontSize: "18px",
                        cursor: "pointer",
                    }}
                    onClick={() => navigate("/")}
                >
                    Sign Out
                </button>
            </div>

            {/* Main Dashboard Content */}
            <div style={{ padding: "20px" }}>
                <h1>Dashboard</h1>
                <button onClick={() => navigate("/updateevent")}>Go to Update Event</button>
                <button onClick={() => navigate("/")}>Back to Home</button>
            </div>
        </div>
    );
}

export default DashboardPage;
